import React from 'react'
import Post from '../components/Post/Post'
import searchPosts from '../components/Input/searchPosts'

import styles from './SearchResultsPage.module.css'

const SearchResultsPage = ({ searchPostsResults }) => (
  <>
  co
    <div className={styles.posts}>
      {/* Маппим массив постов для их отображения */}
      {searchPosts.slice(0, 4).map((post) => (
        <div key={post.id} className={styles.posts}>
          {/* Передаем компоненту Post информацию о посте */}
          <Post post={post} />
        </div>
      ))}
    </div>
    <h2>Галерея</h2>;
  </>
)

export default SearchResultsPage
